import React from "react";

const Contact = () => {
  return (
    <div className="container mx-auto px-4 py-6">
      <h1 className="text-2xl font-bold">Contact Us</h1>
      <p>Feel free to reach out to us for any inquiries or assistance.</p>
    </div>
  );
};

export default Contact;
